import React, { PureComponent } from 'react';
import PropTypes from 'prop-types';

export class Icon extends PureComponent {

    constructor(props){
        super(props);

        this.state = {
            colorActive: '',
            colorInActive: '#C9C9C9'
        }
    }

    render() {
        return (
            <img src={this.props.src}/>
        )
    }
}

Icon.propTypes = {
    epic: PropTypes.bool,
};

export default Icon;
